import { combineReducers } from "redux";
import { loginResponse, verifyResponse } from "../reducers/userReducers"
import { feedResponse, presignedURLResponse, createPostResponse } from "./feedReducers";
export const RootReducer = combineReducers({
	loggedin: loginResponse,
	verifyOTP: verifyResponse,
	dashboardFeed: feedResponse,
	presignedUrl: presignedURLResponse,
	createPost: createPostResponse
})
